import firebase from 'firebase/app'
import 'firebase/auth'
import 'firebase/firestore'
import Rebase from 'rebase'

// export const APIKEY = 'vu82341rf54zhkoz8v5vp8nb6ccsjb'
// export const URL_PATH = 'https://api.barcodelookup.com/v2/products?barcode=9780140157376'
// export const URL_EXTENSION = '&formatted=y&key=vu82341rf54zhkoz8v5vp8nb6ccsjb'



const firebaseConfig = {
    apiKey: process.env.REACT_APP_FIREBASE_KEY,
    authDomain: process.env.REACT_APP_FIREBASE_DOMAIN,
    databaseURL: process.env.REACT_APP_FIREBASE_DATABASE,
    projectId: process.env.REACT_APP_FIREBASE_PROJECT_ID,
    storageBucket: process.env.REACT_APP_FIREBASE_STORAGE_BUCKET,
    messagingSenderId: process.env.REACT_APP_FIREBASE_SENDER_ID

  };
  const app = firebase.initializeApp(firebaseConfig);

  const base = Rebase.createClass(app.database())

  export { base }
